import { Card } from 'react-bootstrap';

function PreviousLetters(props) {
    return (
        <Card className='display-component'>
            <Card.Body>
                <Card.Title>Previous Letters</Card.Title>
                <Card.Text>
                    A
                    B
                    C
                </Card.Text>
            </Card.Body>
        </Card>
    );
}

export default PreviousLetters;
